/*Table structure for table `express_templete` */

DROP TABLE IF EXISTS `express_templete`;

CREATE TABLE `express_templete` (
  `Source_Area_id` int(11) NOT NULL COMMENT '发货区域ID',
  `Target_Area_Id` int(11) NOT NULL COMMENT '收货区域ID',
  `Express_Fee` decimal(13,2) DEFAULT '0.00' COMMENT '邮费',
  `Create_Time` datetime DEFAULT NULL,
  PRIMARY KEY (`Source_Area_id`,`Target_Area_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `express_templete` */

/*Table structure for table `order_header` */

DROP TABLE IF EXISTS `order_header`;

CREATE TABLE `order_header` (
  `Order_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `Order_Number` varchar(22) NOT NULL COMMENT '订单号',
  `Create_Time` datetime NOT NULL COMMENT '下单时间/创建时间',
  `Order_Status_Cd` tinyint(4) NOT NULL COMMENT '订单状态：1 待付款 20 代发货 3 待收货 5 已完成 6 已取消',
  `Order_Type_Cd` tinyint(4) NOT NULL COMMENT '订单类型（1、普通订单；2、礼包订单）',
  `User_Id` int(11) DEFAULT NULL COMMENT '会员ID(会员主键)，根据会员ID可以得知下单人',
  `Order_Pay_Mode_Cd` tinyint(4) NOT NULL COMMENT '订单支付类型（1线上、2线下)',
  `Order_Pay_Way_Cd` tinyint(4) DEFAULT NULL COMMENT '订单支付方式（1微信、2支付、3货到付款、4银联、5余额）',
  `Order_Pay_Status_Cd` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单的支付状态（1未支付、2已支付）',
  `Order_Pay_Amt` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '订单应支付总额(订单实际支付总额--订单总额-优惠总额-红包-积分-购酒劵)',
  `Order_Total_Amt` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '订单总额',
  `Order_Discount_Amt` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '订单的总优惠金额',
  `Order_Express_Amt` decimal(6,2) NOT NULL DEFAULT '0.00' COMMENT '订单快递金额',
  `Order_Remark` varchar(255) DEFAULT NULL COMMENT '客户留言备注',
  `Last_Update_Time` datetime DEFAULT NULL COMMENT '最近修改时间',
  `Order_Product_Amt` decimal(13,2) DEFAULT NULL COMMENT '订单商品的总金额（不含快递，优惠，扣减金额）',
  `Order_Review_Status_Flag` tinyint(4) DEFAULT '0' COMMENT '评价状态1未评价、2已评价',
  `Check_Store_Code` varchar(10) DEFAULT NULL COMMENT '门店核销编码',
  `Order_Send_Store_Id` int(11) DEFAULT NULL COMMENT '订单发货门店ID',
  `Order_Send_Time` datetime DEFAULT NULL COMMENT '订单发货时间',
  `Is_Delete` tinyint(4) DEFAULT '0' COMMENT '是否删除不显示',
  PRIMARY KEY (`Order_Id`),
  KEY `IDX_Order_Admin_User_Admin_User_Id_F` (`User_Id`) USING BTREE,
  KEY `IDX_Order_Order_No_N` (`Order_Number`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=249 DEFAULT CHARSET=utf8 COMMENT='订单表';

/*Data for the table `order_header` */

/*Table structure for table `order_item` */

DROP TABLE IF EXISTS `order_item`;

CREATE TABLE `order_item` (
  `Order_Item_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单详情id',
  `Order_Id` int(11) NOT NULL COMMENT '订单号id',
  `Product_Id` int(11) DEFAULT NULL COMMENT '产品id',
  `Product_Name` varchar(50) NOT NULL COMMENT '产品名称',
  `Tag_Price` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '成本价/门市价',
  `Sale_Price` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '零售价格',
  `Quantity` int(5) NOT NULL DEFAULT '0' COMMENT '产品购买数量',
  `Product_Total` decimal(13,2) NOT NULL COMMENT '订单中该款产品的合计总额',
  `Create_Time` datetime NOT NULL COMMENT '订单详细创建时间',
  PRIMARY KEY (`Order_Item_Id`),
  KEY `IDX_Order_Item_Order_Order_ID_F` (`Order_Id`) USING BTREE,
  KEY `IDX_Order_Item_Product_Pid_F` (`Product_Id`) USING BTREE,
  CONSTRAINT `FK_Order_Item_Order_Order_ID` FOREIGN KEY (`Order_Id`) REFERENCES `order_header` (`Order_Id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=459 DEFAULT CHARSET=utf8 COMMENT='订单详细产品表';

/*Data for the table `order_item` */

/*Table structure for table `order_pay_info` */

DROP TABLE IF EXISTS `order_pay_info`;

CREATE TABLE `order_pay_info` (
  `Order_Pay_Info_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '支付记录id',
  `Order_Id` int(11) NOT NULL COMMENT '订单id',
  `Amount` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `Payamt_Type_Cd` tinyint(4) DEFAULT NULL COMMENT '支付类型（支付/退款）',
  `Serial_No` varchar(40) NOT NULL COMMENT '流水单号',
  `Payamt_Time` datetime NOT NULL COMMENT '交易时间',
  `Exception` varchar(255) DEFAULT NULL COMMENT '支付时出现的异常',
  `Exception_Flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有异常情况',
  PRIMARY KEY (`Order_Pay_Info_Id`),
  KEY `IDX_Payamt_Order_Order_ID_F` (`Order_Id`) USING BTREE,
  CONSTRAINT `FK_Payamt_Order_Order_ID` FOREIGN KEY (`Order_Id`) REFERENCES `order_header` (`Order_Id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=192 DEFAULT CHARSET=utf8 COMMENT='订单支付/退款信息表';

/*Data for the table `order_pay_info` */

/*Table structure for table `order_receive_info` */

DROP TABLE IF EXISTS `order_receive_info`;

CREATE TABLE `order_receive_info` (
  `Order_Id` int(11) NOT NULL,
  `Receive_Name` varchar(50) DEFAULT NULL COMMENT '收货人',
  `Receive_Tel` varchar(20) DEFAULT NULL COMMENT '收货人联系方式',
  `Receive_Province_Id` bigint(20) DEFAULT NULL COMMENT '收货人省编码',
  `Receive_City_Id` bigint(20) DEFAULT NULL COMMENT '收货人市编码',
  `Receive_County_Id` bigint(20) DEFAULT NULL COMMENT '收货人区编码',
  `Receive_Town_ID` bigint(20) DEFAULT NULL COMMENT '镇区ID',
  `Receive_Village_ID` bigint(20) DEFAULT NULL COMMENT '村ID',
  `Receive_Addr` varchar(100) DEFAULT NULL COMMENT '收货人街道地址',
  `Distrbute_Store_Id` int(11) DEFAULT NULL COMMENT '配送门店Id',
  `Last_Update_Time` datetime DEFAULT NULL COMMENT '最后修改时间',
  `Send_Time` datetime DEFAULT NULL COMMENT '发货时间',
  `Order_Distrbute_Type_Cd` tinyint(4) DEFAULT NULL COMMENT '订单派送类型（1.快递方式  2.门店自提）',
  `Order_Express_Num` varchar(60) DEFAULT '' COMMENT '快递单号',
  `Express_ID` int(11) DEFAULT NULL COMMENT '快递公司ID',
  `Express_Time` datetime DEFAULT NULL COMMENT '送货时间',
  PRIMARY KEY (`Order_Id`),
  KEY `FK_Order_County_Id` (`Receive_County_Id`),
  KEY `IDX_Order_Rec_Distri_Store_ID` (`Distrbute_Store_Id`),
  CONSTRAINT `FK_Order_Rec_Order` FOREIGN KEY (`Order_Id`) REFERENCES `order_header` (`Order_Id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单发货信息';

/*Data for the table `order_receive_info` */

/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `Product_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `Product_Name` varchar(200) NOT NULL COMMENT '产品名称',
  `Create_Time` datetime NOT NULL COMMENT '创建时间',
  `Product_Status_Cd` tinyint(4) NOT NULL COMMENT '产品状态（包含 上架:1，下架:2, 删除:-2）',
  `Sku_Key_Json_Str` text COMMENT '子商品SKU的KEY值Json串',
  `Sku_Common_Json_Str` text COMMENT '主商品的SKU的Json数据',
  `Default_Price` decimal(18,2) DEFAULT '0.00' COMMENT '实际销售价',
  `Tag_Price` decimal(18,2) DEFAULT '0.00' COMMENT '标签价',
  `Real_Stock` int(255) DEFAULT NULL COMMENT '真实库存',
  `Virtual_Sale_Cnt` int(11) DEFAULT NULL COMMENT '虚拟销量',
  `Brand_Id` int(11) DEFAULT NULL COMMENT '品牌ID',
  `Category_Id` int(11) DEFAULT NULL COMMENT '系统分类ID',
  `Master_Product_Id` int(11) NOT NULL COMMENT '主产品ID',
  `Last_Update_Time` datetime DEFAULT NULL COMMENT '最近修改时间',
  `Last_Update_User_Id` int(11) DEFAULT NULL COMMENT '最后一个修改人ID',
  `Master_Product_Flag` varchar(255) DEFAULT NULL COMMENT '是否主商品',
  PRIMARY KEY (`Product_Id`),
  KEY `IDX_Product_Category_Category_ID_F` (`Category_Id`),
  KEY `IDX_Prod_Brand_ID_Brand_ID_F` (`Brand_Id`),
  KEY `IDX_Prod_Master_Prod_ID` (`Master_Product_Id`),
  KEY `IDX_Prod_Product_ID` (`Product_Id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='商品';

/*Data for the table `product` */

/*Table structure for table `product_brand` */

DROP TABLE IF EXISTS `product_brand`;

CREATE TABLE `product_brand` (
  `Brand_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '品牌ID',
  `Brand_Name` varchar(100) NOT NULL COMMENT '品牌名称',
  `Status_Cd` tinyint(4) NOT NULL DEFAULT '1' COMMENT '品牌状态',
  `Brand_Img_Url` varchar(100) DEFAULT NULL COMMENT '品牌图片地址',
  `Create_Time` datetime NOT NULL COMMENT '创建时间',
  `Last_Update_Time` datetime DEFAULT NULL COMMENT '最近一次修改时间',
  `Display_ID` int(11) NOT NULL COMMENT '排序ID',
  PRIMARY KEY (`Brand_Id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='商品品牌信息';

/*Data for the table `product_brand` */

/*Table structure for table `product_category` */

DROP TABLE IF EXISTS `product_category`;

CREATE TABLE `product_category` (
  `Category_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '分类ID',
  `Category_Num` varchar(30) NOT NULL COMMENT '分类编码',
  `Category_Name` varchar(50) NOT NULL COMMENT '分类名称',
  `Parent_Category_Id` int(11) DEFAULT NULL COMMENT '父级分类ID',
  `Status_Cd` tinyint(4) NOT NULL COMMENT '分类状态',
  `Display_Id` int(11) NOT NULL COMMENT '显示顺序',
  `Create_Time` datetime NOT NULL COMMENT '创建时间',
  `Last_Update_Time` datetime DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`Category_Id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='商品系统分类';

/*Data for the table `product_category` */

/*Table structure for table `product_pic` */

DROP TABLE IF EXISTS `product_pic`;

CREATE TABLE `product_pic` (
  `Product_Pic_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品图片ID',
  `Product_Id` int(11) NOT NULL COMMENT '产品ID',
  `Pic_Url` varchar(100) NOT NULL COMMENT '图片Url地址',
  `Is_Default_Pic` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否默认显示的图片',
  `Display_Id` tinyint(4) DEFAULT NULL COMMENT '显示顺序',
  `Create_Time` datetime NOT NULL COMMENT '创建时间',
  `Last_Update_Time` datetime NOT NULL COMMENT '最近修改时间',
  PRIMARY KEY (`Product_Pic_Id`),
  KEY `IDX_Prod_Pic_Info_Prod_Id_F` (`Product_Id`),
  CONSTRAINT `FK_Product_Pic_Info_Prod_Id` FOREIGN KEY (`Product_Id`) REFERENCES `product` (`Product_Id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COMMENT='商品图片信息';

/*Data for the table `product_pic` */

/*Table structure for table `product_review` */

DROP TABLE IF EXISTS `product_review`;

CREATE TABLE `product_review` (
  `Review_Id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '评价ID',
  `Product_Id` int(11) DEFAULT NULL COMMENT '商品ID',
  `Order_Id` int(11) DEFAULT NULL COMMENT '订单ID',
  `Review_Status_Cd` tinyint(4) DEFAULT '1' COMMENT '评论状态（-1删除 1通过 2待审 3不通过）',
  `Reviewer_User_Id` int(11) DEFAULT '1' COMMENT '评价人用户ID',
  `Reviewer_Name` varchar(50) DEFAULT NULL COMMENT '评价人姓名',
  `Reviewer_Phone` varchar(20) DEFAULT NULL COMMENT '评价人手机号码',
  `Product_Match_Score` tinyint(4) unsigned DEFAULT NULL COMMENT '商品相识度(评论评分)',
  `Review_Time` datetime NOT NULL COMMENT '评论时间',
  `Review_Content` varchar(500) DEFAULT NULL COMMENT '评论内容',
  `Reply_Time` datetime DEFAULT NULL COMMENT '回复时间',
